window.bookSummaryJSON = "<p><b>Fate is the cruel mistress who crumbled my entire world.</b></p> <p>Hidden truths have surfaced, and I'm forced to question some of the people closest to me. Instead of turning into the shadow form of a demon, I'm a wolf shifter with the same dark fur as my enemies.</p> <p>My fated mate, a sexy silver wolf, should be standing by my side as we face a frightening new enemy, but he was kidnapped along with four other shifters. Saving them could cost my life, but it’ll bring me closer to finding out who...or rather what I am and why I'm being hunted.</p> <p>Everything is falling apart, but I'll do anything to protect my mate and my newfound family…because sometimes, the price of love is the inevitable fall.</p> <p>Scroll up and one-click <i>Shattered Curse</i> today.</p>"; 
